import React from 'react';
import './Quote.css';
import Media from 'react-media';
import { TweenMax, Expo } from 'gsap';

// Quote view Compoennt 
export default function REturnQuOte() {
 return (
  <Media
   queries={{
    small: '(max-width: 599px)',
    medium: '(min-width: 600px) and (max-width:1199px)',
    large: '(min-width: 1200px)',
   }}>
   {matches => (
    <>
     {matches.small && <ScreenSmall />}
     {matches.medium && <ScreenLarge />}
     {matches.large && <ScreenLarge />}
    </>
   )}
  </Media>
 );
};


export const ScreenLarge = () => {
 React.useEffect(() => {
  TweenMax.from('.wrp-quote-success p', 1, { delay: 1.2, opacity: 0, y: 20, ease: Expo.easeIn });
 }, []);

 return (
  <div className='wrp-quote-success'>
   <ViewText />
  </div>
 )
}
export const ScreenSmall = () => {
 React.useEffect(() => {
  TweenMax.from('.wrp-quote-success-sm p', 1, { delay: 1.2, opacity: 0, y: 20, ease: Expo.easeIn });
 }, []);

 return (
  <div className='wrp-quote-success-sm'>
   <ViewText />
  </div>
 )
};
export const ViewText = () => (
 <p>
  Payeer est prêt à fournir des services de paiement pour vos besoins personnels et votre entreprise, nous travaillons avec des marchands et des services de cryptographie du monde entier.
 </p>
);
